  [],\n\t\"revision_timestamp\": \"2015-05-06T22:34:07.051193\",\n\t\"name\": \"charge-dissipating-transparent-conformal-coatings-for-spacecraft-electronics-project\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"The space environment poses significant
  challenges to spacecraft electronics in the form of electrostatic discharge (ESD)
  as a result of exposure to highly charged radiation belts.  The NASA Europa Jupiter
  System Mission environment, for example, exhibits radiation levels seven times greater
  than Earth's geostationary orbit.  In addition to the Jovian environment, highly
  charged environments can also exist at geosynchronous and medium Earth orbits owing
  to solar winds/storms and trapped radiation belts.  Such environments can wreak
  ESD havoc on unprotected critical spacecraft components inside the spacecraft bus.
  \ While existing conformal coatings serve their purpose of insulating and protecting
  electronics from environmental effects, they do not exhibit ESD mitigation qualities.
  \ No solution currently exists to provide both electronic environmental protection,
  optical transparency for component inspection, and charge dissipation characteristics
  in one coating system. To address this need, Luna, in partnership with The Aerospace
  Corporation, proposes to modify industry standard and space-qualified conformal
  coatings by dispersing transparent and conductive nanoparticles within them to impart
  electrical conductivity levels sufficient for charge dissipation and increased radiation
  hardening capability. The proposed coating system will provide the appropriate performance
  properties of both common conformal coating protection and radiation hardening through
  ESD mitigation.\",\n\t\"license_title\": \"U.S. Government Work\",\n\t\"extras\":
